■サイズ：W40×H38(もち手含む)×D10cm<br>■仕様：<br>外面/前面マグネットポケット×1・背面マグネットポケット×1・ダブルファスナーメイン収納×1<br>内面/小物ポケット×3・ジップポケット×1・ボタンポケット×1<br>■付属品：ショルダーストラップ<br>■素材：牛革(クロコ型押し)×合皮<br><br>側面まで開くことの出来るラウンドダブルジップ採用で、分厚い資料やノート型ＰＣなどもらくらく飲み込む大容量ビジネスバッグに仕上がっています。<br>角のない丸みをおびたデザインでコンパクトな印象を持つこのバッグですが、実際は内面ポケットも豊富で、前後のマグネットポケットも非常に収納性が高く、ビジネスシーンで必要なものがほとんど収納可能となっています。<br>表面本体は牛革にクロコダイルの型押しを施しており、感を高める同時にキズや汚れが目立ちにくいように配慮されています。<br>また、両サイドにデザインベルトが付いていてシンプルになりがちなビジネスバッグに、丁度良いインパクトを与えてくれています。<br>前面と背面のマグネットポケットには、使用頻度の高い小物を収納可能で、定期や、名刺入れなどを収納しておくことで、様々なビジネスシーンで頼れる収納スペックとなっています。<br>付属のショルダーベルトは着脱可能のフック式になっていて、長さも調整可能ですので、好きな時に自分に合った形でご使用して頂けるようになっています。</span><font size="3"> </font><br><br></font></div></center><p align="center"><br><br><br><img src="http://image.rakuten.co.jp/bizism/cabinet/logo01/sale01/souryou-01.jpg" width="400" height="125"><br> 【当店お買い上げ金額10,800円以上で全国送料無料！】<style type="text/css">
